:root {
  --purple: #4d14a2;
  --pink: #ff3183;
  --blue: #00ced1;
  --yellow: #ffdd00;
  --white: #fff;
  --card-radius: 20px;
  --btn-radius: 30px;
  --headerMaxWidth: 1300px;
  --contentMaxWidth: 1170px;
  --title-size: clamp(25px, 6vw, 2.2rem);
  --paragraph-size: clamp(16px, 3vw, 1.2rem);
}

html {
  scroll-behavior: smooth;
  scrollbar-gutter: stable;
  overflow: auto;
}

body {
  font-family: 'Quicksand', sans-serif, monospace;
  width: 100%;
}

h1 {
  font-size: var(--title-size);
}

p {
  font-size: var(--paragraph-size);
}

a {
  text-decoration: none;
}

ul {
  list-style: none;
  margin: 0;
}

.primary-btn {
