  transition: all 0.3s ease-in-out;
}

.primary-btn:hover {
  background-color: #00bcd4;
}

.secondary-btn {
  background-color: var(--white);
  color: var(--blue);
  border: 1px solid var(--blue);
  border-radius: var(--btn-radius);
  padding: 12.5px 14px;
  font-size: 12px;
  font-weight: 700;
  text-transform: uppercase;
  cursor: pointer;
  -webkit-transition: all 0.3s ease-in-out;
  transition: all 0.3s ease-in-out;
}

