const { createApp } = Vue;
const isStaging = document.location.hostname.match(/staging\./);

const initOptions = {
  url: isStaging
    ? 'https://login.staging.blydigital.com/'
    : 'https://login.blydigital.com/',
  clientId: 'front-portal',
  realm: 'open-finance',
};

const keycloak = Keycloak(initOptions);
keycloak.init({
  redirectUri: isStaging
    ? 'https://portal.staging.blydigital.com/'
    : 'https://portal.blydigital.com/',
});

const app = createApp({
  methods: {
    onClickLogin() {
      keycloak.login();
    },
    onClickRegister() {
      keycloak.register();
    },
